import React from "react";
import { NavLink } from "react-router-dom";
import s from "./Dialogs.module.css";

const Dialogs = (props) => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogs_item}>
        <h1> Dialogs</h1>
        <ul className={s.item}>
          <li>
            <NavLink className={s.link + ' ' + s.active} to="/dialogs/1">
              Dimych
            </NavLink>
          </li>
        </ul>
        <ul className={s.item}>
          <li>
            <NavLink className={s.link} to="/dialogs/1">
              Gluk
            </NavLink>
          </li>
        </ul>
        <ul className={s.item}>
          <li>
            <NavLink className={s.link} to="/dialogs/1">
              Sasha
            </NavLink>
          </li>
        </ul>
        <ul className={s.item}>
          <li>
            <NavLink className={s.link} to="/dialogs/1">
              Viktor
            </NavLink>
          </li>
        </ul>
        <ul className={s.item}>
          <li>
            <NavLink className={s.link} to="/dialogs/1">
              Valera
            </NavLink>
          </li>
        </ul>
      </div>
      <div className={s.messages}>
        <div className="message_item">hi</div>
        <div className="message_item">you</div>
        <div className="message_item">what</div>
      </div>
    </div>
  );
};

// function Dialogs (props) {
